import React from "react";
import "./styles/Image.css";
import Background from "../assets/images/background-contentContainer.jpg";

const Image = props => (
  <React.Fragment>
    <img
      src={Background}
      alt="broken"
      title="title-picture"
      className="main-pic"
    ></img>
  </React.Fragment>
);

export default Image;
